const initialState = [];

export default  function DeploymentReducer(state=initialState,action)
{
    
    let newstate = Object.assign({},state)
   switch(action.type)
   {

       case 'ADD':
       {
              console.log("ADD FSDFSDF ")
              return   state.Deployments = action.payload;
           
       }
       case 'LOAD':
      {
           console.log("LOAD")
           return   state.Deployments = action.payload;
      }
         case 'DEL':
         {
          return   state.Deployments = [action.payload];
         }
       default:
      {
          return newstate;
      }
       
   }
}
